import React from 'react';
import { useSelector } from 'react-redux';
import AppLayout from '../components/AppLayout';
import Login from './login';
import Profile from './profile';

const Home = () => {

    const {me} = useSelector((state) => state.user);

return (
    <AppLayout>
        {me ? <Profile /> : <Login /> }
    </AppLayout>
    );
}

export default Home;
